import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Row, Col } from 'react-bootstrap';
import logo from './img/logo.jpg'
const App = () => {
  return (
    <Row>
    <Col md={2} className="head-block">

            <img src={logo} alt="" />

    </Col>
</Row>
  );
}



export default App;
